import React, {Component} from 'react';


class Counter extends Component {
    render() {
        return (
            <div className="demo">
                <span className="counter">1,234,567.89</span>
                <span className="counter">99.99</span>
                <span className="counter">1234567</span>
            </div>
        );
    }
}

export default Counter;
